import "./App.css";
import MainSection from "./components/section1/mainSection";
import ClickSpark from "./components/spark/spark";
import Squares from "./components/Squares/squares";
import LiquidEther from "../src/components/LiquidEther/liquidEther";

function App() {
  return (
    <ClickSpark
      sparkColor="#fff"
      sparkSize={30}
      sparkRadius={60}
      sparkCount={5}
      duration={700}
    >
      <section className="relative w-full overflow-hidden">
        {/* Background Squares */}
        <div className="fixed inset-0 -z-10">
          <div style={{ width: "100%", height: 600, position: "relative" }}>
            <LiquidEther
              colors={["#5227FF", "#FF9FFC", "#B19EEF"]}
              mouseForce={20}
              cursorSize={100}
              isViscous={false}
              viscous={30}
              iterationsViscous={32}
              iterationsPoisson={32}
              resolution={0.5}
              isBounce={false}
              autoDemo={true}
              autoSpeed={0.5}
              autoIntensity={2.2}
              takeoverDuration={0.25}
              autoResumeDelay={3000}
              autoRampDuration={0.6}
            />
          </div>
        </div>
        {/* Foreground content */}
        <div className="relative w-full flex flex-col items-center gap-20">
          <MainSection />
        </div>
      </section>
    </ClickSpark>
  );
}
export default App;
